import Link from 'react-router-dom'
import styled from 'styled-components'
import { colors } from '../../utils/style/variables'
import MainCourseIcon from '../../assets/poisson.png'
import Dessert from '../../assets/dessert.png'
import Chef from '../../assets/chef.png'
import Drinks from '../../assets/jus.png'
import Preps from '../../assets/soupe.png'

const StyledMenuWrapper = styled.div`
    display: grid;
    grid-template-columns: repeat(auto-fill, minmax(clamp(50px, 25%, 180px), 1fr));    
    grid-template-rows: clamp(50px, 25%, 180px);
    gap: 30px;
    margin: 0 auto;
    width: 50vw;
    flex-wrap: wrap; 
`
const StyledLink = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: ${colors.tertiary};
    aspect-ratio: 1/1;
    border-radius: 33px;
`
const StyledImg = styled.img`
    width: 70%;
    height: 70%;
    object-fit: cover;
`

function HomeIcon() {
    return (
        <StyledMenuWrapper>
            <StyledLink>
                <StyledImg src={MainCourseIcon} alt='icone dune assiette contenant du poisson'/>
            </StyledLink>
            <StyledLink>
            <StyledImg src={Dessert} alt='icone dune assiette contenant du poisson'/>

            </StyledLink>
            <StyledLink>
            <StyledImg src={Preps} alt='icone dune assiette contenant du poisson'/>

            </StyledLink>
            <StyledLink>
            <StyledImg src={Drinks} alt='icone dune assiette contenant du poisson'/>

            </StyledLink>
        </StyledMenuWrapper>
    )
}

export default HomeIcon
